def get_market_data():
    """Fetch live market data using yfinance"""
    try:
        # Major indices
        indices = {
            '^NSEI': 'Nifty 50',
            '^BSESN': 'Sensex',
            '^DJI': 'Dow Jones',
            '^IXIC': 'NASDAQ'
        }
        
        # Crypto symbols
        crypto_symbols = ['BTC-USD', 'ETH-USD', 'BNB-USD', 'XRP-USD']
        
        # Commodities
        commodities = {
            'GC=F': 'Gold',
            'CL=F': 'Crude Oil'
        }
        
        market_data = {
            'indices': {},
            'crypto': {},
            'commodities': {},
            'top_gainers': [],
            'top_losers': [],
            'most_active': []
        }
        
        # Fetch indices data
        for symbol, name in indices.items():
            try:
                ticker = yf.Ticker(symbol)
                info = ticker.history(period="1d")
                if not info.empty:
                    current_price = info['Close'].iloc[-1]
                    prev_close = info['Open'].iloc[-1]
                    change = current_price - prev_close
                    change_pct = (change / prev_close) * 100
                    
                    market_data['indices'][symbol] = {
                        'name': name,
                        'price': round(current_price, 2),
                        'change': round(change, 2),
                        'change_pct': round(change_pct, 2)
                    }
            except Exception as e:
                logging.error(f"Error fetching {symbol}: {e}")
        
        # Fetch crypto data
        for symbol in crypto_symbols:
            try:
                ticker = yf.Ticker(symbol)
                info = ticker.history(period="1d")
                if not info.empty:
                    current_price = info['Close'].iloc[-1]
                    prev_close = info['Open'].iloc[-1]
                    change = current_price - prev_close
                    change_pct = (change / prev_close) * 100
                    
                    market_data['crypto'][symbol] = {
                        'name': symbol.replace('-USD', ''),
                        'price': round(current_price, 2),
                        'change': round(change, 2),
                        'change_pct': round(change_pct, 2)
                    }
            except Exception as e:
                logging.error(f"Error fetching {symbol}: {e}")
        
        # Fetch commodities data
        for symbol, name in commodities.items():
            try:
                ticker = yf.Ticker(symbol)
                info = ticker.history(period="1d")
                if not info.empty:
                    current_price = info['Close'].iloc[-1]
                    prev_close = info['Open'].iloc[-1]
                    change = current_price - prev_close
                    change_pct = (change / prev_close) * 100
                    
                    market_data['commodities'][symbol] = {
                        'name': name,
                        'price': round(current_price, 2),
                        'change': round(change, 2),
                        'change_pct': round(change_pct, 2)
                    }
            except Exception as e:
                logging.error(f"Error fetching {symbol}: {e}")
        
        # Get top gainers/losers from NSE (sample symbols)
        nse_symbols = ['RELIANCE.NS', 'TCS.NS', 'HDFCBANK.NS', 'INFY.NS', 'ICICIBANK.NS', 
                      'HINDUNILVR.NS', 'SBIN.NS', 'BHARTIARTL.NS', 'KOTAKBANK.NS', 'LT.NS']
        
        stock_data = []
        for symbol in nse_symbols:
            try:
                ticker = yf.Ticker(symbol)
                info = ticker.history(period="1d")
                if not info.empty:
                    current_price = info['Close'].iloc[-1]
                    prev_close = info['Open'].iloc[-1]
                    change_pct = ((current_price - prev_close) / prev_close) * 100
                    
                    stock_data.append({
                        'symbol': symbol.replace('.NS', ''),
                        'price': round(current_price, 2),
                        'change_pct': round(change_pct, 2)
                    })
            except Exception as e:
                logging.error(f"Error fetching {symbol}: {e}")
        
        # Sort for top gainers and losers
        stock_data.sort(key=lambda x: x['change_pct'], reverse=True)
        market_data['top_gainers'] = stock_data[:5]
        market_data['top_losers'] = stock_data[-5:]
        market_data['most_active'] = stock_data[:5]  # Simplified for now
        
        return market_data
        
    except Exception as e:
        logging.error(f"Error fetching market data: {e}")
        return {}

def get_financial_news():
    """Fetch financial news from RSS feeds"""
    try:
        import feedparser
        
        news_feeds = [
            'https://economictimes.indiatimes.com/rssfeedsdefault.cms',
            'https://www.moneycontrol.com/rss/business.xml'
        ]
        
        all_news = []
        
        for feed_url in news_feeds:
            try:
                feed = feedparser.parse(feed_url)
                for entry in feed.entries[:5]:  # Get top 5 from each feed
                    all_news.append({
                        'title': entry.title,
                        'link': entry.link,
                        'summary': entry.get('summary', '')[:200] + '...',
                        'published': entry.get('published', ''),
                        'source': feed.feed.get('title', 'Financial News')
                    })
            except Exception as e:
                logging.error(f"Error fetching from {feed_url}: {e}")
        
        return all_news[:10]  # Return top 10 news items
        
    except ImportError:
        # Fallback if feedparser is not available
        return [
            {
                'title': 'Financial News',
                'link': '#',
                'summary': 'Unable to fetch news at this time. Please check back later.',
                'published': datetime.now().strftime('%Y-%m-%d'),
                'source': 'System'
            }
        ]
    except Exception as e:
        logging.error(f"Error fetching news: {e}")
        return []

